description:
Вступайте в программу лояльности мобильном приложении АЗС «Сеганч», накапливайте и списывайте бонусные баллы с помощью QR-кода на экране вашего телефона. Находите ближайшие к вам заправочные станции, будьте в курсе скидок и акций.
Программа лояльности «SG Бонус» сети АЗС «Сеганч» разработана для автолюбителей, которые хотят контролировать свои расходы и получать за них бонусы, ценят удобство и комфорт. Присоединяйтесь к программе лояльности «SG Бонус» и ощутите все ее преимущества. 
Мобильное приложение Сети АЗС Сеганч позволяет легко и удобно:
- Накапливать бонусы за заправку и оплачивать бонусами покупки в кафе и магазинах на АЗС;
- Следите за изменениями бонусного счета онлайн;
- Узнать статус Вашей карты – размер скидки в режиме онлайн;
- Просмотреть историю покупок;
- Участвовать в акциях и получать подарки;
- Узнавать о видах и стоимости топлива, а также о сервисах на каждой АЗС;
- Прокладывать маршрут до АЗС;
- Актуальные новости компании и другая информация.
- Направлять отзыв - нам очень важно ВАШЕ мнение!
Мы всегда с Вами и работаем для Вас! Единый центр поддержки клиентов +992 92 928 0000.
Скачивайте приложение «АЗС Сеганч», становитесь участником программы лояльности «SG Бонус» - получайте максимум от каждой заправки автомобиля.

Получайте баллы за покупки в сети АЗС «Сугднефть» и обменивайте их на топливо или товары из магазина!
Подробное описание
Экономить – это хорошая привычка! Экономить с нами – приятнее вдвойне! Ведь теперь для получения бонусных баллов за покупку не нужно брать с собой пластиковую карту, достаточно показать экран мобильного телефона оператору-кассиру на АЗС и бонусные баллы за покупку будут моментально зачислены!
Вы до сих пор не являетесь держателем бонусной картой сети АЗС «Сугднефть»? Установите мобильное приложение и закажите бонусную карту с доставкой прямо в руки! 
И всё важное у вас будет под рукой:
- Баланс бонусной карты – нет необходимости уточнять у оператора-кассира АЗС баланс бонусной карты, или звонить в колл-центр, вы сами всегда сможете посмотреть баланс вашей бонусной карты в мобильном приложении; 
- Отслеживание совершённых покупок – не забывайте о своих расходах, а также полученных бонусах за покупку. Детальная статистика ваших покупок всегда у вас под рукой;
- Актуальные цены на топливо – планируйте бюджет покупки заблаговременно, ведь теперь вы сможете посмотреть цены на топливо прямо в мобильном приложении;
- Бонусная карта в мобильном приложении – вам больше не нужно носить с собой пластиковую бонусную карту сети АЗС «Сугднефть», достаточно показать экран мобильного приложения оператору-кассиру на АЗС и получить бонусные баллы за покупку;
- Проложить маршрут к удобной вам АЗС – сэкономьте время и проложите удобный для вас маршрут до нужной АЗС;
- Заказать бонусную карту с доставкой в руки – нет времени оформлять бонусную карту на АЗС? Оформите дистанционно и мы доставим её вам в руки!
- Будьте в курсе последних новостей компании;
- Отслеживайте информацию о регулярных акциях и льготных мероприятий.
Экономить вместе с АЗС «Сугднефть» - выгодно, удобно и безопасно!

